import React, { useMemo } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { FetchMensProducts } from '../redux/actions/productActions';
import store from '../redux/store';
import { useEffect } from 'react';
import { Link } from 'react-router-dom/cjs/react-router-dom.min';
import InfiniteScroll from 'react-infinite-scroll-component';

const Mens = () => {
  console.log('Mens section');
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(FetchMensProducts());
  }, []);

  const data = useSelector((state) => state.mens.data);
  console.log(data);
  const rendermens = useMemo(() => {
    return (
      <div>
        {data?.map((product) => {
          const { id, title, price, category, image } = product;
          return (
            <div className='ui grid cona'>
              <div className="four wide column" key={id}>
                <Link to={`/product/${id}`}>
                  <div className="ui link cards">
                    <div className="card">
                      <div className="image">
                        <img src={image} alt={title} />
                      </div>
                      <div className="content">
                        <div className="header">{title}</div>
                        <div className="meta price">$ {price}</div>
                        <div className="meta">{category}</div>
                      </div>
                    </div>
                  </div>
                </Link>
              </div>
            </div>
          );
        })}
      </div>
    );
  },[data]);
  return <p>{rendermens}</p>;
};

export default Mens;
